let e=$(location).attr("href");$("#btnSearch").on("click",function(){e=e.split("?"),e=e[0];let t=$("#table-search").val(),c=$("#date").val(),l=`${e}?keyword=${t}&date=${c}`;$(this).attr("href",l)});$("#table-search").keydown(function(t){t.keyCode===13&&(t.preventDefault(),document.getElementById("btnSearch").click())});$("#clearSearch").on("click",function(){e=e.split("?"),e=e[0],$(this).attr("href",e)});$("#keyword").keyup(function(t){t.preventDefault(),t.keyCode===13&&document.getElementById("commonSearchBtn").click()});
